import React from 'react';
import './App.css';


import Header from './component/Header/index';
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from "react-router-dom";

interface Props{

}

type State = typeof initState;

const initState = {
  string: "Hello my friend" as string
}

class App extends React.Component<Props,State>{
  state= initState;

  render(){
    return(
      <BrowserRouter>
        <div className="App">
          <Header/>
          <Link to="/">Home</Link>
          <Link to="/about">About</Link>
          <Link to="/dashboard">Dashboard</Link>
        </div>
        <Switch>
          <Route exact path="/">
            <div>/</div>
            {/* <Home /> */}
          </Route>
          <Route path="/about">
            <div>/about</div>
            {/* <About /> */}
          </Route>
          <Route path="/dashboard">
            <div>/dashboard</div>
            {/* <Dashboard /> */}
          </Route>
        </Switch>
      </BrowserRouter>

    );
  }
}

export default App;
